import React from "react";
import {
  FormControl,
  FormLabel,
  FormErrorMessage,
  FormHelperText,
  Input,
} from "@chakra-ui/react";

function InputFields() {
  return (
    <div>
      <FormControl>
        <FormLabel>Email address</FormLabel>
        <Input />
        <FormHelperText>We'll never share your email.</FormHelperText>
      </FormControl>
    </div>
  );
}

export default InputFields;
